import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';


function ItemList({item}){
    return (
        <div>
            {item.map(i => (
                <div key={i.id}>
                    <h2>{i.title}</h2>
                </div>
            ))}
        </div>
    );
}

export default ItemList;
